$templateCache.put('/app/home/templates/qualification-levels.html','<div>\r\n<h4 class="Headings"><center>Qualification levels</center></h4>\r\n<h5 class="link-line"><a href="/epm/sep/assets/docs/Qualification_Progression_Flow_v1_4.pdf" target="_blank">Download: Field Technician Competence Progression Flow</a></h5>\r\n<h5 class="Headings">Qualification Levels - From Installation to Troubleshooting</h5>\r\n<p><span class="contentStrong">1.1.1\tLevel 1 \u2013 Installation: </span></p>\r\n           <span class="content">Technicians have limited practical and theoretical technical knowledge of the Network Elements in their competence area.  Technicians are able to:</span>\r\n        <ul>\r\n            <li class="content"> Understand Installation-related working procedures </li>\r\n            <li class="content"> Understand local working practices, supplier awareness, and health, safety, and ESD regulations. </li>\r\n            <li class="content"> Complete Installation-related activities, but technician holds limited practical task experience. </li>\r\n            <li class="content"> Convey adequate working knowledge of customer service skills and local practices. </li>\r\n            <li class="content"> Understand the roles and responsibilities of their immediate manager, colleagues, and other project interfaces. </li>\r\n            <li class="content"> Convey knowledge of tools, database, documentation, and processes. </li>\r\n            <li class="content"> Show the following characteristics: attention to detail, open and willing to learn, good interpersonal / cultural skills.</li>\r\n        </ul>\r\n        \r\n        <p><span class="contentStrong">1.1.2\tLevel 2 \u2013 Commissioning & Integration </span></p>\r\n           <span class="content">Technicians have a developing practical and theoretical technical knowledge of the Network Elements in their competence area.  In addition to Level 1 skills, technicians are able to:</span>\r\n        <ul>\r\n            <li class="content"> Understand Installation-, Commissioning-, and Integration-related working procedures. </li>\r\n            <li class="content"> Independently carry out Commissioning, Integration, and Network Element site acceptance. </li>\r\n            <li class="content"> Recover from problems that arise unexpectedly when following Work Instructions, technical notes, change notes/deliveries, or software (SW)/hardware (HW) errors in the equipment. </li>\r\n            <li class="content"> Provide assistance in complex technical actions, such as SW upgrades and technical audits. </li>            \r\n            <li class="content"> Understand the GNIC concept and is able to work according to the set processes</li>\r\n        </ul>\r\n        \r\n        <p><span class="contentStrong">1.1.3\tLevel 3 \u2013 Basic Troubleshooting</span></p>\r\n           <span class="content">Technicians have a developed practical and theoretical technical knowledge of the Network Elements in their competence area.  In addition to Level 1 & 2 skills, technicians are able to:</span>\r\n        <ul>            \r\n            <li class="content"> Convey deeper technical knowledge and ability to apply the knowledge in practice. </li>\r\n            <li class="content"> Support others in technical matters. </li>            \r\n            <li class="content"> Show the following characteristics: initiative, problem solving, adaptability, decision-making, risk management, and the ability to support others.</li>\r\n            \r\n        </ul>\r\n        \r\n        <p><span class="contentStrong">1.1.4\tLevel 4 \u2013 Advanced Troubleshooting</span></p>\r\n           <span class="content">Technicians have a highly developed practical and theoretical technical knowledge of the Network Elements in their competence area.  In addition to Level 1, 2, & 3 skills, technicians are able to:</span>\r\n        <ul>\r\n            <li class="content"> Understand all working procedures. </li>\r\n            <li class="content"> Apply and communicate highly developed technical knowledge.</li>\r\n            <li class="content"> Independently carry out advanced tasks such as troubleshooting, SW upgrades, technical audits, customer acceptance tests, swaps, database splitting, complex Integration, and multi-vendor troubleshooting. </li>\r\n            <li class="content"> Carry out activities such as parameter fine-tuning using complex network measurement equipment (e.g., protocol analyzers). </li>\r\n            <li class="content"> Understand troubleshooting ca and apply technical knowledge across system-level. </li>\r\n            <li class="content"> Ask and take managed risks in the execution of work. </li>\r\n            <li class="content"> Give guidance to others in all the tasks across system-level. </li>\r\n            <li class="content"> Work in the customer interface for consultancy type activities. </li>\r\n            <li class="content"> Show the following characteristics: influence and persuasiveness, active sharing of information and knowledge, a high Level of responsibility.</li>\r\n        </ul>\r\n</div>\r\n');
$templateCache.put('/app/home/templates/qualification-process.html','<div>\r\n        <h4 class="Headings"><center>Qualification Process</center></h4>\r\n\r\n        <ul>\r\n                <li ng-if="qpCtrl.apac"><a class="link-line" href="/epm/sep/assets/docs/qualification-process/APAC_TI_SeS_CoDe_and_Qualification_Process_v4.pdf" target="_blank">APAC Qualification Process</a></li>\r\n                <li ng-if="qpCtrl.china"><a class="link-line" href="/epm/sep/assets/docs/qualification-process/China_Supplier_CoDe_And_Licencing.pdf" target="_blank">China Qualification Process</asp:HyperLink></li>\r\n                <li ng-if="qpCtrl.nam"><a class="link-line" href="/epm/sep/assets/docs/qualification-process/Service_Supplier_Qualification_Process_DN05135034_Rev_2_0.pdf" target="_blank">NAM Qualification Process</a></li>\r\n        </ul>\r\n        <div class="row top-margin1">\r\n               <div class="col-md-9 col-xs-12">\r\n\r\n                <div class="content">\r\n                        <p class="content">The Supplier Excellence Center Qualification Process v1.5 encompasses training, verification and Qualification in a comprehensive seven-step process:</p>\r\n\r\n                        <p class="content"><span class="subtitle">Step 1. Candidate Pre-qualification</span><br/> \r\n                                To ensure that trainees meet the minimum requirements before entering the Supplier Excellence Program, they must fulfill certain criteria before participating in training. </p>\r\n\r\n                                <p class="content"><span class="subtitle">Step 2. Classroom Technical/Theoretical Training</span><br/> \r\n                                        In an interactive classroom environment equipped with appropriate hardware, all Methods of Procedure (MOPs) and documentation are reviewed with the trainees, and any questions are addressed.</p>\r\n\r\n                                        <p class="content"><span class="subtitle">Step 3. Supplier Excellence Practical Taining</span><br/> \r\n                                                Trainees are given an opportunity to practice all of the hands-on steps involved in the execution of MOPs. In each practical training session, all trainees will have an opportunity to practice the specified MOP as often as required. </p>\r\n\r\n                                                <p class="content"><span class="subtitle">Step 4. Written Examination</span><br/> \r\n                                                        The written examination takes place in the Supplier Excellence Center classroom environment. Assessment material is prepared by Nokia Solutions and Networks Site Engineering and is designed to assess the trainee\'s knowledge. </p>\r\n\r\n                                                        <p class="content"><span class="subtitle">Step 5. Practical Examination</span><br/> \r\n                                                                The practical portion of the examination takes place in the Supplier Excellence Center. Each trainee is graded according to pre-established criteria included on the Practical Examination Checklist, in order to determine field ability. </p>\r\n\r\n                                                                <p class="content"><span class="subtitle">Step 6. Qualification</span><br/> \r\n                                                                        When trainees meet the criteria for both the written and practical examinations, they are issued a certificate and Qualification permitting them to work on a Nokia Solutions and Networks project site. Once introduced as a technician, each Qualificatione is given a trainee identification (PTID) and entered into the Qualificatione database. This database catalogs all trainees\' competencies to ensure that work is performed by Qualificationd technicians only. </p>\r\n\r\n                                                                        <p class="content"><span class="subtitle">Step 7. Continuous Assessment</span><br/> \r\n                                                                                On-site auditing is carried out as part of normal Project Management activities. The results of these audits are used as a continuous assessment of the technicians\' performance, and as inputs for the design of an appropriate competence development plan. </p>\r\n\r\n                                                                        </div>\r\n                                                                </div>\r\n                                                                <div class="col-md-3 col-xs-12">\r\n                                                                      <img class="img-responsive" src="/epm/sep/assets/images/QualificationProcess7Steps.gif">\r\n                                                              </div>\r\n                                                      </div>\r\n                                              </div>');
$templateCache.put('/app/home/templates/sec-overview.html','<div>\r\n\t<h4 class="Headings"><center>Supplier Excellence Center - Overview</center></h4>\r\n\t<div class="row">\r\n\t\t<div class="col-md-7 col-xs-12 content">\r\n\r\n\t\t\t<span class="contentStrong">The Supplier Excellence Centers<br /></span> support the development of new service business by ensuring a practical training methodology and quality process solution for Nokia employees, customers, suppliers and associates.\r\n\t\t\t<br /><br />\r\n\t\t\tThe Supplier Excellence Centers are full-time training facilities that ensure appropriate competence in the implementation workforce. Training and development planning are provided to match customer needs and the priorities of the Nokia Regional Organization. \r\n\t\t\tAll training in the Supplier Excellence Centers is conducted by Nokia subject matter experts trained in instructional techniques. This ensures effective and uniform delivery of training material.\r\n\t\t\t<br /><br />\r\n\t\t\tThe Supplier Excellence Centers are managed to the highest quality standards, with efficient administration and streamlined communications. trainee will have an opportunity to practice the specified MOP as often as required. \r\n\t\t\t<br /><br />\r\n\r\n\t\t\t<span class="contentStrong">Quality Standards<br /></span> \r\n\t\t\tQuality is the foundation of the Supplier Excellence Program, so Nokia places primary focus on quality control of the technical competencies of staff and trainers, as well as those of the service suppliers who have been trained. The key to these quality standards are the Quality Assurance and Quality Uplift programs as well as our people. The staff and trainers of the Supplier Excellence Centers work closely with Nokia Site Engineering, which also performs regular, formal audits of their methods and technical skills. The quality of the implementation work performed by service suppliers in the field is verified and checked against the project requirements through Nokia-approved quality checklists and procedures. \r\n\t\t\t<br /><br />\r\n\r\n\t\t\t<span class="contentStrong">Efficient Administration<br /></span> \r\n\t\t\tThe daily operation of the Supplier Excellence Centers follows Standard Operating Procedures that are uniform throughout the country. The Supplier Excellence Centers update all the required information on their activities and progress into a central information system, where it is accessible to Nokia managers and project personnel over the Web.\r\n\t\t\t<br /><br />\r\n\r\n\t\t\t<span class="contentStrong">Streamlined Communications<br /></span>\r\n\t\t\tReporting on the activities of the Supplier Excellence Centers is extremely important for maintaining communications with all stakeholders. The Supplier Excellence Centers provide regular reports highlighting activities, schedules, methods of procedures (MOPs), licensing information and more. Additionally, personal follow-up is facilitated in the regions as required. \r\n\t\t\t<br /><br />\r\n\t\t</div>\r\n\t\t<div class="col-md-5 col-xs-12">\r\n\t\t\t<img class="img-responsive" src="/epm/sep/assets/images/SEPChart3.jpg">\r\n\t\t</div>\r\n\t</div>\r\n</div>');
$templateCache.put('/app/home/templates/sep-overview.html','<div>\r\n\r\n        <h4 class="Headings"><center>Supplier Excellence Program - Overview</center></h4>\r\n        <p>Nokia is dedicated to the highest standards of workmanship, processes and behavior in the deployment of high quality network implementation across the complete Nokia service delivery chain. The Supplier Excellence Program is focused on achieving this high quality. \r\n        </p>\r\n        <p>Site Engineering in Nokia works with Project Management Services, Regional Management Teams, Services Procurement and Nokia Competence Development Services to ensure that the best resources and practices are applied in network deployment activities. The Supplier Excellence Program addresses all aspects of the services\u2019 operation in the field and on driving best practices and highest quality.\r\n        </p>\r\n        <p>The Nokia Supplier Excellence Program is built on a foundation of quality \u2013 high-quality products and high-end technical solutions \u2013 delivered throughout all Nokia service operations.\r\n        </p>\r\n        <p>The Supplier Excellence Program measures its success through the attainment of Customer Satisfaction, complying with the Nokia Values.<br>\r\n        </p>\r\n        <div>\r\n                <ul class="nav nav-tabs" ng-init="sepfooterCtrl.septabs=1">\r\n                        <li ng-class="(sepfooterCtrl.septabs==1)?\'active\':\'non-active-tab\'"><a data-toggle="tab" ng-click="sepfooterCtrl.septabs=1">The Teams</a></li>\r\n                        <li ng-class="(sepfooterCtrl.septabs==2)?\'active\':\'non-active-tab\'"><a data-toggle="tab" ng-click="sepfooterCtrl.septabs=2">SEP Overview</a></li>\r\n                        <li ng-class="(sepfooterCtrl.septabs==3)?\'active\':\'non-active-tab\'"><a data-toggle="tab" ng-click="sepfooterCtrl.septabs=3">SEP Web Pages</a></li>\r\n                        <li ng-class="(sepfooterCtrl.septabs==4)?\'active\':\'non-active-tab\'"><a data-toggle="tab" ng-click="sepfooterCtrl.septabs=4">SEP Quality and Safety Management</a></li>\r\n                </ul>\r\n\r\n                <div class="tab-content top-margin1 left-margin">\r\n                        <div class="tab-pane fade" ng-class="(sepfooterCtrl.septabs==1)?\'in active\':\'\'">\r\n                                <span class="contentStrong">Services Procurement</span>\r\n                                <li class="content">Prequalification of New Service Suppliers</li>\r\n                                <li class="content">Selection and Management of Service Suppliers</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Site Engineering</span>\r\n                                <li class="content">Management of Nokia Licensing Program</li>\r\n                                <li class="content">Database of Licensed Technicians and Engineers</li>\r\n                                <li class="content">Quality Uplift Program</li>\r\n                                <li class="content">Operation of Supplier Excellence Centers</li>\r\n                                <li class="content">Competence Development Planning for External Resources</li>\r\n                                <li class="content">Capacity Planning of External Resources</li>\r\n                                <li class="content">Quality Action Plans and Deficiency Correction</li>\r\n                                <li class="content">Customer Awareness Program</li>\r\n                                <li class="content">Technical support to Supplier Excellence Centers</li>\r\n                                <li class="content">Definition of Implementation Processes</li>\r\n                                <li class="content">Construction of Method of Procedures (MOP)</li>\r\n                                <li class="content">Setting Licensing Accreditation Standards for Licensing</li>\r\n                                <li class="content">Nokia Quality Processes</li>\r\n                                <li class="content">Nokia Quality Audits</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Competence Development Services</span>\r\n                                <li class="content">Classroom Training</li>\r\n                                <li class="content">Advanced Training</li>\r\n                                <li class="content">Product Specific Certification</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Project Management</span>\r\n                                <li class="content">Site Quality Reporting</li>\r\n                                <li class="content">Reporting on Technician Performance</li>\r\n                                <li class="content">Application of Supplier Excellence Program in the Field</li>\r\n                                <li class="content">Documentation of Best Implementation Practices and Learning</li>\r\n                        </div>\r\n                        <div class="tab-pane fade" ng-class="(sepfooterCtrl.septabs==2)?\'in active\':\'\'">\r\n                                <div class="content">The Supplier Excellence Program is the application of continuous improvement to all service activities in Nokia. The components of the program are:</div>\r\n                                <br />  \r\n                                <span class="contentStrong">The Nokia Values</span>\r\n                                <li class="content">Customer satisfaction</li>\r\n                                <li class="content">Respect</li>\r\n                                <li class="content">Achievement</li>\r\n                                <li class="content">Renewal</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Service Supplier Prequalification Processes</span>\r\n                                <li class="content">Professional processes applied by Nokia Services Procurement to source the best service supplier and develop the best subcontracting strategies.</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Subcontractor Selection and Management</span>\r\n                                <li class="content">Services Procurement applies industry best practices to the selection and management of the most appropriate application of resources.</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">External Resourcing and Management</span>\r\n                                <li class="content">Using external consultants in the most efficient way to ensure the highest competences applied at the right time and in the most efficient way to support the project quality.</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Supplier Excellence Center</span>\r\n                                <li class="content">Market and region based facilities where field resources are given hands-on access to the equipment being deployed in a controlled and managed environment.</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Licensing Management</span>\r\n                                <li class="content">Ensuring that the competences of the field technicians are validated with appropriate qualifications based on training received in Supplier Excellence Centers.</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Quality Uplift Program</span>\r\n                                <li class="content">A targeted program that ensures that poor quality work is quickly identified and immediate and appropriate remedial action applied through the Supplier Excellence Centers.</li>\r\n                                <br>\r\n\r\n                                <span class="contentStrong">Quality Audits and Verification</span>\r\n                                <li class="content">Independent audits to ensure that the measures are true and representative of the wider quality goals of Nokia.</li>\r\n\r\n                        </div>\r\n                        <div class="tab-pane fade" ng-class="(sepfooterCtrl.septabs==3)?\'in active\':\'\'">\r\n                                <div class="content">The Supplier Excellence Program works through uniform processes and central sources of information. The Program maintains a central web site that provides direct access for Nokia managers and field technicians to appropriate content to:</div><br>\r\n\r\n                                <span class="contentStrong"></span>\r\n                                <li class="content">The Quality Information and Scores for the Nokia Projects</li>\r\n                                <li class="content">The Availability of Supplier Excellence Centers in the Markets</li>\r\n                                <li class="content">Training Courses\u2019 Availability, Schedules and Locations</li>\r\n                                <li class="content">Nokia Methods of Procedure</li>\r\n                                <li class="content">License Status</li>\r\n                                <li class="content">Project News</li>\r\n\r\n                        </div>\r\n                        <div class="tab-pane fade" ng-class="(sepfooterCtrl.septabs==4)?\'in active\':\'\'">\r\n                                <div class="content">Quality and safety management within the Supplier Excellence Program is assured by:</div>\r\n\r\n                                <span class="contentStrong"></span>\r\n                                <li class="content">Implementing a Quality Assurance System</li>\r\n                                <li class="content">Verification by Nokia Site Engineering</li>\r\n                                <li class="content">Feedback loop with Project Quality Control</li>\r\n                                <li class="content">Implementing the Health and Safety Policy</li>\r\n                                <br>\r\n                                <div class="content"><span class="contentStrong">The Quality Plan\r\n                                </span><br /><br />The Quality Plan for network implementation is developed by Project Management and sets the benchmarks to be achieved by the Supplier Excellence Program. The key elements of the Quality plan are:</div>\r\n\r\n                                <span class="contentStrong"></span>\r\n                                <li class="content">Clear and Communicated Quality Targets and Key Performance Indicators (KPI)</li>\r\n                                <li class="content">Customer Approval of the Quality Targets</li>\r\n                                <li class="content">Customer Reporting Requirements</li>\r\n                                <li class="content">Project Reporting Requirements</li>\r\n                                <li class="content">Auditing Plan</li>\r\n                                <br>\r\n                                <div class="content"><span class="contentStrong">Scope Supported by the Supplier Excellence Program</span><br />The Supplier Excellence Program provides support to all the key technologies and services provided by Nokia including:</div>\r\n\r\n                                <span class="contentStrong"></span>\r\n                                <li class="content">2G Ultrasite and FlexiBTS</li>\r\n                                <li class="content">3G FlexiBTS</li>\r\n                                <li class="content">4G FlexiBTS</li>\r\n                                <li class="content">Core Installation and Standards</li>\r\n                                <li class="content">Site Preparation</li>\r\n                                <li class="content">Antenna Line Installation and Commissioning</li>\r\n                                <li class="content">Equipment Removal and Installation</li>\r\n                                <li class="content">3rd Party Equipment Removal</li>\r\n                                <li class="content">Transmission Systems</li>\r\n                                <li class="content">Power Systems</li>\r\n                                <br>\r\n                        </div>\r\n\r\n                </div>\r\n        </div>\r\n\r\n</div>');
