$templateCache.put('/app/home/templates/ssi-overview.html','<div>\r\n\t<h4 class="Headings"><center>Service Supplier Information - Overview</center></h4>\r\n\t<div class="row">\r\n\t\t<div class="col-md-7 col-xs-12">\r\n\r\n\t\t\t<div class="content">\r\n            As a service supplier, you have already shown that you have the qualities and characteristics that Nokia looks for in Supplier Excellence Program partners \u2013 such as: &ldquo;value added&rdquo; capabilities, a proven track record, good financial status, quality processes, hardware and software technology capabilities, and a sound understanding of our business. \r\n            <br /><br />\r\n            Now we can build on those credentials in an atmosphere of openness and trust. Read more to understand the key elements that drive our successful relationship: \r\n            <br /><br />\r\n        </div>\r\n        \r\n        <ul type="square">\r\n            <li class="content"><span class="contentStrong">Organization: </span>Nokia has built an effective organization to address all aspects of services operations in the field.</li>\r\n            <li class="content"><span class="contentStrong">Supplier Diversity: </span>Benefiting from differences is an important aspect of our business for many reasons: increasing creativity, mirroring our marketplace and improving attraction and retention.</li>\r\n            <li class="content"><span class="contentStrong">Our Quality Focus: </span>Quality is not an end goal, but a continuous process. Learn about the two key building blocks of quality throughout the Supplier Excellence Program.</li>\r\n        </ul>\r\n\r\n\t\t</div>\r\n\t\t<div class="col-md-5 col-xs-12">\r\n\t\t\t<img class="img-responsive" src="/epm/sep/assets/images/SSI_Overview.jpg">\r\n\t\t</div>\r\n\t</div>\r\n</div>');
